import { Box, Divider, Heading, Text, VStack } from "@chakra-ui/react";
import React from "react";

const RandomRecipe = () => {
  return (
    <>
      <VStack mt={20} h="full">
        <Heading>Recipe:</Heading>
        <Divider width="500px" />
        <Box
          w="2xl"
          maxW="2xl"
          // maxW="lg"
          // maxW="sm"
          borderWidth="1px"
          borderRadius="lg"
          overflow="hidden"
        >
          <Text>Time to Prepare: 30 mins</Text>
        </Box>
      </VStack>
    </>
  );
};

export default RandomRecipe;
